import React from "react";

function Nav() {
  return (
    <nav className="navbar navbar-expand-lg bg-primary">
      <a className="navbar-brand" href="/">
        Google Books
      </a>
      <a className="nav-link" href="#">Search<span class="sr-only">(current)</span></a>
      <a className="nav-link" href="#">Saved</a>

    </nav>
  );
}

export default Nav;
